import React from "react";
import ErrorPageWrapper from "../../assets/wrappers/ErrorPage/ErrorPageWrapper";
import { Container, Row, Col } from "react-bootstrap";
import notFound from "../../assets/images/404.svg";
import wrongPath from "../../assets/images/wrongPath.svg";
import { Link } from "react-router-dom";
import { ButtonSecondary } from "../../components";
import { Arrow90degLeft } from "react-bootstrap-icons";

const ErrorPage = () => {
  return (
    <ErrorPageWrapper>
      <Container fluid>
        <Row>
          <Col lg={12}>
            <img src={wrongPath} />
            <h2 className="mt-5">Ooooops</h2>
            <h5>Wrong path mate!</h5>
            <Link to="/">
              <Arrow90degLeft />
              <span className="ms-1"> Go Back</span>
            </Link>
          </Col>
        </Row>
      </Container>
    </ErrorPageWrapper>
  );
};

export default ErrorPage;
